description: >-
  Folytassuk a buliszériát a kedvenc helyszínünkön! 


  Salsa és Bachata buli a Cafe Radnótiban!


  Kubai hangulat, jobbnál jobb zenék és a kedvenc animációitok, egészen hajnal 1-ig! 


  Ismét a legjobb latin ritmusokkal, sokszínű salsa és bachata zenékkel várunk!

  Nem az számít, hogy hol és mennyit tanultál, gyere és élvezd a tánc világát, amit mindannyian szeretünk!


  A program:

  20:00 - 01:00 Buli megállás nélkül, ruedákkal, animációkkal (salsa, reggaeton)

  Zenék mindenkinek, kezdőtől haladó szintig, salsa és bachata, klasszikusok és aktuális slágerek, buli zenéktől a romantikáig, megszakítás nélkül.


  Belépő:

  2000 Ft


  Főbejárat a Göncz Árpád sétány felől! 

